import Contact from './Contact.js'

class Home extends Component{
    constructor(props){
        super(props);
        this.state={
            data:"",
        }
    }
   onChang=(e)=>{
       this.setState({
           data:e.tar
       })
   };
    render(){
       return (
           <div>
               <input type="text" onChange={onChang}/>
           <h1> {this.props.nam}</h1>
           <Contact address={'abcd'}/>

           </div>

       )

    }

}

export default Home;
